import s from './Gallery.module.css'
import React from "react";


let GalleryBlue = (props) => {
console.log(props);
    let galery = props.galleryBlue.map(e=>

            <div className={s.itemGallery}>
                <img src={e.img} alt={e.alt}/>
            </div>
    );

    return(
        <div className={s.q}>
        <div className={s.blockGallery}>
            <h1 className={s.title}> who we`ve worked with</h1>
            <div className={s.area}>  {galery} </div>
           <button></button>
            <button></button>
        </div>
        </div>
    );
};
export default GalleryBlue;
